import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Router, Route,Swi } from 'react-router-dom';
import { Login,Register,Logout } from './components/Auth';
function App() {
  return (
    <div className="App">

      <Router>

      <Route exact pathname='signup' Component={Register}/>
      <Route exact pathname='login' Component={Login}/>
     <Logout/>
     </Router>

    </div>
  );
}

export default App;
